  --icon--size: 18px;
  display: grid;
  grid-template-columns: var(--icon--size) var(--icon--size);
  gap: 30px;
}
@media (min-width: 744px) {
  .header__links {
    --icon--size: 24px;
  }
}
@media (min-width: 744px) {
  .header__links {
    gap: 40px;
  }
}
.header__title {
  font-size: 36px;
  line-height: 100%;
  display: flex;
  align-self: center;
  letter-spacing: -1.5px;
  white-space: nowrap;
}
