  .header__title {
    font-size: 64px;
  }
}
@media (min-width: 1020px) {
  .header__title {
    font-size: 80px;
  }
}

.icon {
  position: relative;
  background-position: center;
  background-repeat: no-repeat;
  background-size: contain;
  width: 24px;
  height: 24px;
  padding-bottom: 100%;
}
@media (min-width: 744px) {
  .icon {
    width: 32px;
    height: 32px;
  }
}
@media (min-width: 1020px) {
  .icon {
    width: 32px;
    height: 32px;
  }
}
.icon__tooltip {
  display: block;
  position: absolute;
  right: 100%;
  top: 50%;
  transform: translateY(-50%);
  align-self: center;
  width: max-content;
  margin-right: 12px;
  transition: opacity 0.3s;
  opacity: 0;
  pointer-events: none;
  font-size: 12px;
  color: #fff;
  letter-spacing: 2px;
  text-transform: uppercase;
}
.icon--phone {
  background-image: url("/a3aaf4073f0d605c07048e42b979c70b.svg");
}
