    pointer-events: all;
  }
}
.icon--menu {
  background-image: url("/43edad825757bd377e6d98c42b71b4ce.svg");
}
.icon--menu:hover {
  background-image: url("/bc69e31e7a94f2b81d03087c58a3782b.svg");
}
.icon--close {
  background-image: url("/6d256905a0d77fb1cd1806644440cd52.svg");
}

.info__title {
  margin-bottom: 8px;
  font-weight: 400;
  font-size: 14px;
  line-height: 20px;
  color: #fff;
}
.info__link {
  font-weight: 500;
  font-size: 16px;
  line-height: 22px;
  color: #fff;
  text-decoration: none;
  position: relative;
  transition: color 0.3s ease;
}
.info__link:hover {
  color: grey;
}

.menu {
  background-color: #e5e5e5;
  font-weight: 600;
  text-transform: uppercase;
}
