  .menu__content {
    padding: 36px 2px 200px;
  }
}
.menu__list {
  margin: 0 0 40px;
  padding: 0;
  font-size: 22px;
  line-height: 22px;
  letter-spacing: 2px;
  list-style: none;
}
.menu__item:not(:last-child) {
  margin-bottom: 24px;
}
.menu__link {
  display: inline-block;
  padding-bottom: 8px;
  border-bottom: 1px solid transparent;
  text-decoration: none;
  color: #1d1d1d;
  transition: border-color 0.3s;
}
.menu__link:hover {
  border-color: #1d1d1d;
}
.menu__call {
  display: block;
  width: max-content;
  color: #1d1d1d;
}
.menu__call--phone {
  margin-bottom: 16px;
  text-decoration: none;
  font-size: 16px;
  line-height: 27px;
}
.menu__call--action {
  padding-bottom: 8px;
  border-bottom: 1px solid #1d1d1d;
  text-decoration: none;
  font-size: 12px;
  line-height: 16px;
  letter-spacing: 2px;
  text-underline-position: below;
}

.page {
  font-family: "Poppins", sans-serif;
  scroll-behavior: smooth;
}
.page__body {
  background: #1d1d1d;
  color: #fff;
}
.page__body--with-menu {
  overflow: hidden;
}
.page__menu {
  position: fixed;
  left: 0;
  top: 0;
  right: 0;
  transform: translateX(-100%);
  transition: transform 0.3s;
  z-index: 1;
}
.page__menu:target {
  transform: translateX(0);
}
.page__section {
  margin-bottom: 80px;
}
