sources.styles/blocks/menu.scss:
.menu {
  background-color: #e5e5e5;
  font-weight: 600;
  text-transform: uppercase;

  @include onDesktop {
    font-weight: 700;
  }

  &__top {
    @include topActions;
    margin-bottom: 44px;
  }

  &__links {
    @include links;
    grid-template-columns: var(--icon--size);
  }

  &__content {
    box-sizing: border-box;
    height: 100vh;
    padding: 30px 2px 90px;

    overflow-y: auto;
    overflow-x: hidden;

    @include onTablet {
      padding: 34px 2px 130px;
    }

    @include onDesktop {
      padding: 36px 2px 200px;
    }
  }

  &__list {
    margin: 0 0 40px;
    padding: 0;

    font-size: 22px;
    line-height: 22px;
    letter-spacing: 2px;
    list-style: none;
  }

  &__item {
    &:not(:last-child) {
      margin-bottom: 24px;
    }
  }

  &__link {
    display: inline-block;
    padding-bottom: 8px;
    border-bottom: 1px solid transparent;
    text-decoration: none;

    color: $color-dark;

    transition: border-color $transition-time;

    &:hover {
      border-color: $color-dark;
    }
  }

  &__call {
    display: block;
    width: max-content;

    color: $color-dark;

    &--phone {
      margin-bottom: 16px;

      text-decoration: none;
      font-size: 16px;
      line-height: 27px;
    }

    &--action {
      padding-bottom: 8px;
      border-bottom: 1px solid $color-dark;

      text-decoration: none;
      font-size: 12px;
      line-height: 16px;
      letter-spacing: 2px;
      text-underline-position: below;
    }
  }
}

sources.styles/blocks/page.scss:
.page {
  font-family: "Poppins", sans-serif;
  scroll-behavior: smooth;

  &__body {
    background: $color-dark;
    color: $color-white;

    &--with-menu {
      overflow: hidden;
    }
  }

  &__menu {
    position: fixed;
    left: 0;
    top: 0;
    right: 0;

    transform: translateX(-100%);
    transition: transform $transition-time;

    z-index: 1;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-bottom: 80px;

    @include onTablet {
      margin-bottom: 120px;
    }

    @include onDesktop {
      margin-bottom: 150px;
    }
  }

  &__section-title {
    text-align: center;

    font-weight: 500;
    font-size: 32px;
    line-height: 1;
    letter-spacing: -1.5px;
    text-transform: capitalize;

    &--last {
      text-transform: none;
    }

    @include onTablet {
      font-size: 48px;
    }

    @include onDesktop {
      font-size: 64px;
    }
  }
}

sources.styles/blocks/gallery.scss:
.gallery {
  &__photos {
    margin-bottom: 16px;
  }

  &__photo-container {
    position: relative;
    padding-bottom: 100%;
    transition: transform 0.3s;

    width: 100%;

    &:hover {
      transform: scale(1.05);

    }

    @include onTablet {
      padding-bottom: 0;

      height: 187px;
    }

    @include onDesktop {
      height: 320px;
    }

  }

  &__photo {
    position: absolute;
    object-fit: cover;
    object-position: center;

    width: 100%;
    height: 100%;
  }

  &__title {
    margin-bottom: 8px;

    @include thirdTitle;
  }

  &__paragraph {
    @include deafultParagraph;
    margin-bottom: 48px;
    max-width: 660px;
  }
}

